import React from 'react';
import Hed from './Hed';
import HedM from './HedM';
import HedF from './HedF';
import './App.css';

export default class Header extends React.Component {
  render() {
    return (
      <header>
        <Hed />
        <HedM />
        <HedF />
      </header>
    );
  }
}
